--[edfi].[Calendar] 
---------------------------------------------------------------------------------------------------------
--The PupulatedTemplate always comes with one school(255901107 = Grand Bend Elementary School) by default 
--let's add the middle and high schools
----------------------------------------------------------------------------------------------------------
INSERT INTO [edfi].[Calendar] (CalendarCode,SchoolId,SchoolYear,CalendarTypeDescriptorId,Discriminator,CreateDate,LastModifiedDate)
--255901044	Grand Bend Middle School
SELECT CalendarCode,255901044,SchoolYear,CalendarTypeDescriptorId,Discriminator,CreateDate,LastModifiedDate
FROM [edfi].[Calendar] 
WHERE SchoolId =255901107
UNION
--255901001	Grand Bend High School
SELECT CalendarCode,255901001,SchoolYear,CalendarTypeDescriptorId,Discriminator,CreateDate,LastModifiedDate
FROM [edfi].[Calendar] 
WHERE SchoolId =255901107

--[edfi].[StaffElectronicMail]
-- We are deploying to the ed-fi Power BI Online Services. Lets update to the email accounts that are in there.
UPDATE edfi.StaffElectronicMail
set ElectronicMailAddress=(SELECT LOWER(SUBSTRING(STA.FirstName,1,1) + sta.LastSurname + '@edfidev.onmicrosoft.com') 
                           FROM edfi.Staff STA WHERE STA.StaffUSI=StaffElectronicMail.StaffUSI);
