--[edfi].[CalendarDateCalendarEvent]
---------------------------------------------------------------------------------------------------------
--The PupulatedTemplate always comes and empty table
--let's populate it. 
----------------------------------------------------------------------------------------------------------
DECLARE @holidayDescriptorId INT, @instDayDescriptorId INT;
--descriptor ids can potentially change from one populated template to another
SELECT @holidayDescriptorId = DescriptorId FROM edfi.Descriptor WHERE Namespace = 'uri://ed-fi.org/CalendarEventDescriptor'  AND CodeValue = 'Holiday'
SELECT @instDayDescriptorId = DescriptorId FROM edfi.Descriptor WHERE Namespace = 'uri://ed-fi.org/CalendarEventDescriptor'  AND CodeValue = 'Instructional day'

